void demodulationFM::thread_hdltv_gen() {
    const char* dump_tv = std::getenv("AP_WRITE_TV");
    if (!(dump_tv && string(dump_tv) == "on")) return;

    wait();

    mHdltvinHandle << "[ " << endl;
    mHdltvoutHandle << "[ " << endl;
    int ap_cycleNo = 0;
    while (1) {
        wait();
        const char* mComma = ap_cycleNo == 0 ? " " : ", " ;
        mHdltvinHandle << mComma << "{"  <<  " \"ap_rst\" :  \"" << ap_rst.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"ap_start\" :  \"" << ap_start.read() << "\" ";
        mHdltvoutHandle << mComma << "{"  <<  " \"ap_done\" :  \"" << ap_done.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"ap_idle\" :  \"" << ap_idle.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"ap_ready\" :  \"" << ap_ready.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"y_I_V_address0\" :  \"" << y_I_V_address0.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"y_I_V_ce0\" :  \"" << y_I_V_ce0.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"y_I_V_q0\" :  \"" << y_I_V_q0.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"y_Q_V_address0\" :  \"" << y_Q_V_address0.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"y_Q_V_ce0\" :  \"" << y_Q_V_ce0.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"y_Q_V_q0\" :  \"" << y_Q_V_q0.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"y_demod_d_V_address0\" :  \"" << y_demod_d_V_address0.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"y_demod_d_V_ce0\" :  \"" << y_demod_d_V_ce0.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"y_demod_d_V_we0\" :  \"" << y_demod_d_V_we0.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"y_demod_d_V_d0\" :  \"" << y_demod_d_V_d0.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"ap_return\" :  \"" << ap_return.read() << "\" ";
        mHdltvinHandle << "}" << std::endl;
        mHdltvoutHandle << "}" << std::endl;
        ap_cycleNo++;
    }
}

